import React from 'react';

import './footer.css'

export const Footer = () => {
    return (
        <div className="container">
            <h2>@HUSHPUPPIESCO</h2>
            <i class="fab fa-facebook-f"></i>
            <i class="fab fa-instagram-square"></i>
        </div>
    )
}
